class paddleObj{ height:number; width:number; x:number; color:string; y:number; 
	constructor(height:number, width:number,	x:number, color:string, y:number)
	{
		this.height = height;
		this.width = width;
		this.x = x;
		this.color = color;
		this.y = y;
	}
}
export default paddleObj
